CREATE DEFINER=`root`@`localhost` PROCEDURE `add_book`(title_name VARCHAR(150),pub_date date,
isbnn bigint(20) UNSIGNED,editon int(2) UNSIGNED,auth_name VARCHAR(80),sub_name VARCHAR(120),pub_name VARCHAR(80))
BEGIN
DECLARE ck,B_ID,T_ID,P_ID,S_ID,A_ID int(4);
	
	set ck = (SELECT COUNT(case when ISBN = isbnn then 1 end ) from book);
IF ck > 0 then
	set B_ID = (SELECT book_id from book where ISBN = isbnn LIMIT 1);
	insert into book_copy 
	SELECT B_ID,(SELECT MAX(copy_no)+1 from book_copy where book_id = B_ID),CURDATE()
	from dual;
	SELECT 'COPY GENERATED' from dual;
ELSE
	INSERT into book(ISBN,publication_date,Edition)
	values (isbnn,pub_date,editon);
	set B_ID = (SELECT book_id from book where ISBN = isbnn LIMIT 1);
	
	insert into book_copy (book_id,book_added_date)
	values (B_ID,CURDATE());
	INSERT into book_title(title)
	SELECT UPPER(title_name) from dual
	where not exists (SELECT * from book_title where title = UPPER(title_name));
	insert into author(author_name)
	SELECT UPPER(auth_name) from dual
	where not exists (SELECT * from author where author_name = UPPER(auth_name));
	insert into subject(subject_name)
	SELECT UPPER(sub_name) from dual
	where not exists (SELECT * from subject where subject_name = UPPER(sub_name));	
	insert into publisher(name)
	SELECT UPPER(pub_name) from dual
	where not exists (SELECT * from publisher where name = UPPER(pub_name));
	
	SET A_ID = (SELECT author_id from author where author_name = UPPER(auth_name));
	SET S_ID = (SELECT subject_id from subject where subject_name = UPPER(sub_name));
	SET P_ID = (SELECT pub_id from publisher where name = UPPER(pub_name));
	SET T_ID = (SELECT title_id from book_title where title = UPPER(title_name));
	
	insert into book_details(book_id,title_id,author_id,publisher_id,subject_id)
	values (B_ID,T_ID,A_ID,P_ID,S_ID);
	
	END IF;
END ;;
