CREATE DEFINER=`root`@`localhost` PROCEDURE `issue_book`(B_ID int(5),P_ID VARCHAR(7),expire DATE)
BEGIN
DECLARE C_ID int(5);
if book_issued_to_(P_ID) > 3 then
	
SELECT 2,'NO BOOK CAN BE ISSUED BECAUSE YOU REACHED YOUR LIMIT' as msg from dual;
ELSE
SET C_ID = (  
SELECT bc.copy_no 
from 
(SELECT * from book_copy where book_id = B_ID)bc
LEFT JOIN (SELECT * from book_issue_details where return_date is null)bd
ON (bc.book_id,bc.copy_no) = (bd.book_id,bd.copy_no)
where bd.book_id IS NULL
and bd.copy_no IS NULL
and bd.person_id IS NULL
LIMIT 1); 
IF C_ID IS NULL 
then
SELECT 0,'NO BOOK CAN BE ISSUED' as msg from dual;
ELSE
insert into book_issue_details(book_id,copy_no,person_id,expiry_date,issue_date)
values (B_ID,C_ID,P_ID,expire,NOW());
SELECT 1,B_ID,C_ID,P_ID,expire from dual; 
END IF;
END IF;
    END ;;
