CREATE DEFINER=`root`@`localhost` PROCEDURE `user_validate`(user varchar(7),pass varchar(20))
BEGIN
DECLARE 
	user_exist,pass_match varchar(1);
	
	SET user_exist = (SELECT COUNT(*) from person_login where username = UPPER(user));
	IF user_exist = '1' THEN
		SET pass_match = (SELECT COUNT(*) from person_login where username = UPPER(user) and password = pass);
		IF pass_match = '1' THEN
			UPDATE person_login SET last_login = NOW() WHERE username = UPPER(user) and password = pass;
			IF substring(UPPER(user),2,1) = 'U' THEN
				SELECT 1,'USER LOGGED IN' as msg;
			ELSEIF substring(UPPER(user),2,1) = 'F' THEN
				IF (SELECT TYPE FROM FACULTY where lib_id = UPPER(user))='ADMIN' THEN
					SELECT 2,'ADMIN LOGGED IN' as msg;
				ELSE
					SELECT 3,'FACULTY LOGGED IN' as msg;
				END IF;
			END IF;
		ELSE
			SELECT 0,'Password doesnot match' as msg;
		END IF;
	ELSE
		SELECT -1,'Username is invalid' as msg;
	END IF;	
END ;;
DELIMITER ;
