CREATE DEFINER=`root`@`localhost` PROCEDURE `view_profile`(p_id varchar(7))
begin
IF p_id = '*' THEN
	select p.person_id , pn.first_name , pn.last_name , pa.address , pa.phone , p.email , p.last_update
	from person p , person_address pa , person_name pn
	where p.person_id = pn.person_id and p.address_id = pa.address_id;
ELSEIF p_id = 'LU' THEN
	SELECT * from user_vu;
ELSEIF p_id = 'LF' THEN
	SELECT * from fac_vu;
ELSE
	select * from user_vu where person_id = p_id;
END IF;
end ;;
